Clone_of_Rejected_1.query:
q = load "${App.Datasets.HLS_Care_Request8_tp.FullyQualifiedName}";
q = filter q by 'Case.IsClosed' == "false";
q = filter q by 'Case.Status' == "Not Approved";
q_B = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_1.selection, 0, "Text2").asString()}}];
q_C = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_1.selection, 0, "Text3").asString()}}];
result = group q by all full, q_B by all full, q_C by all;
result = foreach result generate unique(q.'Id') as 'A', unique(q_B.'Id') as 'B', unique(q_C.'Id') as 'C';
result = foreach result generate 'B' as 'CareRequest Rejected', (B-C)/C as 'Percentage_Change_In_CareRequest';

